import React from 'react';
import {Button} from 'react-bootstrap';

const ErrorPage = (props) => {
  return (
    <div>
      <h1>Error</h1>
      <Button variant="outline-danger">Back Home</Button>{' '}
      <Button variant="outline-info">Report Error to Administrator</Button>{' '}
    </div>
  );
};

export default ErrorPage;
